window.bookSummaryJSON = "<p><b>Welcome to the Carnival of Creeps, where you'll feast your eyes on the freaks.</b></p> <p>For two days a year, a carousel sings. Humans come, but they do not leave. Gremlins, ghouls, and sincasters need to feed.</p> <p>If paranormals come, they will never be free. They have to put on a show and give the audience the creeps.</p> <p>A demon is a ringmaster, selling souls for the right price. A fortune teller sees his demise. A vampire is used to cry. An angel loses his wings. A banshee calls for help and screams.</p> <p>They will no longer exist after Halloween. It's why they need a Wildes witch. The most powerful one they will ever see.</p> <p>Contains mature themes.</p>"; 
